INSERT INTO `encabezado` VALUES ('46', '2013-06-20 17:54:49', '332', '9', '2', '2', 'terminado', 'La encuesta debe distinguir que hay dos tipos de docentes: de planta y de catedra para los cuales la reglamentacion de la universidad es diferente. En lo referente a beneficios los docentes de planta cuentan con el apoyo institucional total, sin embargo no es el caso de los otros docentes');
INSERT INTO `encabezado` VALUES ('47', '2013-06-20 17:59:05', '390', '9', '4', '4', 'terminado', 'El proceso de admisión al programa de matemáticas debe ser mas riguroso para evitar tanto la deserción temprana como el bajo rendimiento de los estudiantes durante la carrera.');
