INSERT INTO `encabezado` VALUES ('50', '2013-06-20 19:46:27', '382', '9', '4', '4', 'terminado', 'El programa va creciendo con el paso del tiempo consolidándose a nivel regional, nacional e internacional, lo cual es positivo para nosotros los egresados que hemos encontrado muchos campos abiertos debido a este crecimiento con calidad.');
