INSERT INTO `encabezado` VALUES ('91', '2013-06-30 10:14:51', '358', '9', '2', '2', 'terminado', '\r\nQUE LAS DIRECTIVAS DEL PROGRAMA SEAN MAS AUTÓNOMAS Y QUE NO DEPENDAN TANTO DE LO QUE DICE EL DECANO, EN OTRAS PALABRAS QUE EL DIRECTOR DEL PROGRAMA DE MATEMÁTICAS SEA AUTÓNOMO Y QUE SE LE DE LA IMPORTANCIA QUE ESTE TIENE, QUE NO SEA UNA SIMPLE SECRETARÍA MÁS, QUE ES LO QUE SE VIENE DANDO EN LOS ÚLTIMOS AÑOS. ');
