INSERT INTO `encabezado` VALUES ('94', '2013-07-02 10:52:56', '415', '9', '4', '4', 'terminado', 'El programa necesita docentes que fomenten el espíritu investigativo en los estudiantes, lo cual contribuira a una mejor formacion en el estudiantado asi como la mejora en la calidad educativa el programa');
