INSERT INTO `encabezado` VALUES ('97', '2013-07-02 17:34:24', '372', '9', '4', '4', 'terminado', 'mejorar el sentido de las electivas para la orientación de los educandos en el acompañamiento con los DOCTORES que deben ser los más propicios para que definan las electivas que se pueden brindar en el programa, afianzar en las matemáticas aplicadas como electivas y linea de investigación dándole el sentido en las diferentes ramas de la ciencia');
INSERT INTO `encabezado` VALUES ('98', '2013-07-03 09:53:32', '287', '9', '1', '1', 'terminado', '');
INSERT INTO `encabezado` VALUES ('99', '2013-07-03 14:26:42', '383', '9', '4', '4', 'terminado', 'Tener en cuenta que existe gran demanda de docentes de matemáticas en muchos sectores del país y que al salir como matemáticos a enfrentarnos a laborar como docentes nos encontramos con cuestiones como parcelar, llenar documentos escolares entre otras cosas y aunque el programa no está enfocado en crear docentes de básica secundaria se debería implementar una asignatura o curso libre que enseñe esto.');
INSERT INTO `encuesta` VALUES ('1', 'FO-DO/AA-002', 'ENCUESTA PARA ESTUDIANTES', 'Recolectar información sobre la percepción que la comunidad universitaria tiene de los procesos académicos y administrativos desarrollados por el programa para el logro de sus objetivos misionales, con el fin de adelantar el proceso de autoevaluación de programas.', 'A continuación encontrará una serie de afirmaciones, valórelas según su grado de acuerdo con la siguiente escala de calificación: \r\n5 - Completamente de acuerdo\r\n4 - De acuerdo\r\n3 - Parcialmente de acuerdo\r\n2 - En desacuerdo\r\n1 - Completamente en desacuerdo\r\n0 - No sabe', '1', '00', '18/04/2012');
