INSERT INTO `encuesta` VALUES ('8', 'FO-DO/AA-002', 'ENCUESTA PARA ESTUDIANTES', 'Recolectar Información que permita evaluar la calidad del programa, con\r\nfundamento en los indicadores de las características contempladas en el modelo\r\nde autoevaluación con fines de acreditación de la Institución.', 'Las preguntas abiertas están orientadas a obtener información cualitativa y detallada con el fin de establecer la calidad del programa académico en sus distintos aspectos y, a la vez, establecer planes de mejoramiento para los mismos. \r\nLas preguntas cerradas deben ser evaluadas según el grado de cumplimiento del enunciado, de acuerdo con la siguiente escala de calificación así:\r\n5 - Muy Alto\r\n4 - Alto\r\n3 - Medio\r\n2 - Bajo\r\n1 - Muy Bajo\r\n0 - No sabe', '2', '00', '18/04/2012');
