INSERT INTO `glosario` VALUES ('1', 'proyecto educativo', 'Tiene la función de establecer un marco global de referencia para coordinar todas las actuaciones de la comunidad educativa. Integra la realidad del centro y de su entorno definiendo metas propias y señas de identidad para la consecución de los objetivos educativos del centro');
INSERT INTO `indicador` VALUES ('1', '1.1.1', 'Documentos institucionales en los que se expresa la misión y visión de la institución.', '1', '1');
INSERT INTO `indicador` VALUES ('2', '1.1.2', 'Existencia y utilización de medios para difundir la misióny visión institucional.', '1', '1');
INSERT INTO `indicador` VALUES ('3', '1.1.3', 'Grado de correspondencia entre el contenido de la misión, visión institucional y los objetivos del programa académico.', '1', '1');
INSERT INTO `indicador` VALUES ('4', '1.1.4', 'Porcentaje de directivos, profesores, personal administrativo, estudiantes y egresados que entienden el sentido de la Misión, Visión del programa y la comparten.', '1', '1');
INSERT INTO `indicador` VALUES ('5', '1.1.5', 'Existencia políticas que garanticen el acceso a la educación superior sin discriminación, así mismo para orientar identificar, eliminar o disminuir barreras en infraestructura física, accesibilidad y movilidad.', '1', '1');
INSERT INTO `indicador` VALUES ('6', '1.2.1', 'Existencia y utilización de estrategias y mecanismos establecidos para la discusión, actualización y difusióndel proyecto educativo del programa académico.', '2', '1');
INSERT INTO `indicador` VALUES ('7', '1.2.2', 'Porcentaje de directivos, profesores y estudiantes que conocen y comparten el sentido del proyecto educativo del programa', '2', '1');
INSERT INTO `indicador` VALUES ('8', '1.2.3', 'Apreciación de directivos, profesores y estudiantes sobre la existencia de espacios institucionales para la discusión y actualización permanente del proyecto educativo del programa.', '2', '1');
INSERT INTO `indicador` VALUES ('9', '1.2.4', 'Correspondencia entre el proyecto educativo del programa y el proyecto institucional.', '2', '1');
INSERT INTO `indicador` VALUES ('10', '1.2.5', 'Existencia del Modelo pedagógico en el PEP que refleje la metodología de enseñanza que utilice el programa', '2', '1');
INSERT INTO `indicador` VALUES ('11', '1.2.6', 'Existencia de documento que relacione lo expresado en el PEP con las actividades académicas desarrolladas', '2', '1');
INSERT INTO `indicador` VALUES ('12', '1.2.7', 'Existencia de documentos que evidencien actividades de seguimiento del PEP', '2', '1');
INSERT INTO `indicador` VALUES ('13', '1.3.1', 'Evidencia sobre la reflexión y análisis de las tendencias y líneas de desarrollo en áreas disciplinares a nivel local, regional, nacional e internacional', '3', '1');
INSERT INTO `indicador` VALUES ('14', '1.3.2', 'Número y tipo de actividades del programa que muestran la relación del plan curricular con las necesidades locales, regionales, nacionales e internacionales.', '3', '1');
INSERT INTO `indicador` VALUES ('15', '1.3.3', 'Apreciación de empleadores del sector público y/o privado y demás entes locales, regionales, nacionales o internacionales sobre la relevancia académica y pertinencia social del programa, y sobre el reconocimiento de sus egresados.', '3', '1');
INSERT INTO `indicador` VALUES ('16', '1.3.4', 'Número y tipo de actividades y/o proyectos que adelanta el programa de acuerdo a las necesidades del entorno.', '3', '1');
INSERT INTO `indicador` VALUES ('17', '1.3.5', 'Existencia de estudios y/o proyectos formulados o en desarrollo, que propendan por la modernización, actualización y pertinencia del currículo.', '3', '1');
INSERT INTO `indicador` VALUES ('18', '1.3.6', 'Estudio en el cual se exprese el impacto del programa en el medio.', '3', '1');
INSERT INTO `indicador` VALUES ('19', '2.4.1', 'Existencia de políticas, criterios y reglamentaciones para la admisión de estudiantes de manera transparente.', '4', '1');
INSERT INTO `indicador` VALUES ('20', '2.4.2', 'Relación de estudiantes que ingresaron mediante la aplicación de reglas generales y mecanismos de admisión excepcionales, en los últimos cinco años.', '4', '1');
INSERT INTO `indicador` VALUES ('21', '2.4.3', 'Evidencias de evaluación y seguimiento a los procesos de selección y admisión y aplicación de los resultados de dicha evaluación.', '4', '1');
INSERT INTO `indicador` VALUES ('22', '2.4.4', 'Existencia de políticas y procedimientos para el ingreso de estudiantes en condición de transferencia, homologación u otro proceso que amerite criterios específicos para el tránsito entre ciclos, niveles y/o instituciones.', '4', '1');
INSERT INTO `indicador` VALUES ('23', '2.4.5', 'Evidencia de beneficios de los requerimientos de homologación y transferencia para los estudiantes.', '4', '1');
INSERT INTO `indicador` VALUES ('24', '2.5.1', 'Documentos que expresen las políticas institucionales para la definición del número de estudiantes que se admiten al programa, acorde con el cuerpo docente, recursos físicos y apoyo académico disponibles.', '5', '1');
INSERT INTO `indicador` VALUES ('25', '2.5.2', 'Apreciación de profesores y estudiantes del programa con respecto a la relación entre el número de admitidos, el cuerpo docente y los recursos académicos y físicos disponibles.', '5', '1');
INSERT INTO `indicador` VALUES ('26', '2.5.3', 'Población de estudiantes que ingresó al programa en los últimos cinco años, el puntaje promedio obtenido por los admitidos en las Pruebas de Estado, el puntaje promedio estandarizado en pruebas de admisión cuando éstas se realicen, el puntaje mínimo acept', '5', '1');
INSERT INTO `indicador` VALUES ('27', '2.5.4', 'Programas de salud. Relación de convenios docencia-servicio requeridos para los objetivos del Programa.', '5', '1');
INSERT INTO `indicador` VALUES ('28', '2.5.5', 'Programas de salud. Relación entre el número de estudiantes y la capacidad instalada de los escenarios de práctica (camas, docentes, tutores, investigadores, entre otros).', '5', '1');
INSERT INTO `indicador` VALUES ('29', '2.5.6', 'Programas de salud, Relación de profesores asistenciales, nivel de formación y experiencia en formación.', '5', '1');
INSERT INTO `indicador` VALUES ('30', '2.6.1', 'Documentos institucionales en los que se expresan las políticas y estrategias definidas por el programa en materia de formación integral de los estudiantes.', '6', '1');
INSERT INTO `indicador` VALUES ('31', '2.6.2', 'Apreciación de los estudiantes sobre la calidad de los espacios y estrategias que ofrece el programa, de acuerdo con la naturaleza y orientación de éste, para la participación en grupos o centros de estudio, proyectos de experimentación o de desarrollo em', '6', '1');
INSERT INTO `indicador` VALUES ('32', '2.6.3', 'Número de estudiantes que participan en grupos de estudio, proyectos de experimentación o de desarrollo empresarial o en las demás actividades académicas y culturales distintas de la docencia que brinda la Institución o el Programa para contribuir a la fo', '6', '1');
INSERT INTO `indicador` VALUES ('33', '2.7.1', 'Evidencias de mecanismos de divulgación del Reglamento Estudiantil en el Programa', '7', '1');
INSERT INTO `indicador` VALUES ('34', '2.7.2', 'Apreciación de estudiantes y profesores del programa sobre la pertinencia, vigencia y aplicación del reglamento estudiantil.', '7', '1');
INSERT INTO `indicador` VALUES ('35', '2.7.3', 'Evidencias de aplicación del Reglamento estudiantil en situaciones especiales de los estudiantes.', '7', '1');
INSERT INTO `indicador` VALUES ('36', '2.7.4', 'Apreciación de directivos, profesores y estudiantes sobre la participación del estudiantado en los órganos de dirección del programa.', '7', '1');
