INSERT INTO `numericadocumental` VALUES ('289', 'El programa cuenta con dos aulas de dedicación exclusivas para la eEspecializacion en el tercer piso con un espacio aproximado de 100 mts2 con una capacidad para 40 personas cada una, con sus respectivas sillas móviles y tablero en acrílico, con video beam disponible, y computador; adicionalmente se cuenta con una sala de uso para la Especializacionon 10 computadores de uso exclusivo de posgrado, cabe resaltar que tienen acceso ilimitado a las salas de informática de la universidad que por facultad representan alrededor de 2 salas con una capacidad promedio de 30 personas, en un futuro inmediato se pondrá en funcionamiento un edificio inteligente con mas de 100 computadores que permanecerá disponible las 24 horas al día.', 'decano, Jefe de Investigación, Jefe de Posgrado, Coordinador de la Especializacion', 'magnetico', 'departamento academico', '5', 'Incentivar el uso de los espacios asignados', '7', '2', '393');
INSERT INTO `numericadocumental` VALUES ('290', 'Se cuenta con 14 laboratorios para la investigación con un área total de 1249 mts2, lo que nos da una relación de 249,8mts2 por estudiante, distribuidos de la siguiente manera: edificio de la facultad de medicina se cuenta con laboratorio de: fisiología, toxicología, patología, histotecnologia, biología, histología y microbiología, bioquímica, urgencia y simulación, cirugía experimental, investigación, farmacología y un bioterio, en la facultad de química se cuenta con 3 laboratorios. En las tres sedes de la universidad se cuenta con una biblioteca, el edificio de zaragocilla es de dedicación exclusiva para el área de la salud, cuanta con tres pisos, con un área aproximada 2000mts2, distribuidos así: primer piso sala de consulta para base de datos y documentos de referencia, segundo piso sala general, tercer piso hemeroteca; El programa dispone de un salón para las tutorías con una capacidad para 10 personas con sillas móviles.', 'Decano, Jefe de Investigación, Jefe de Posgrado, Coordinador de la Especializacion', 'magnetico', 'departamento academico', '5', 'Incentivar el uso de los espacios asignados', '7', '2', '394');
