INSERT INTO `numericadocumental` VALUES ('359', 'En materia de adquisición y actualización del material bibliográfico el programa, a través del Decano, solicita al Comité Central de Biblioteca la bibliografía pertinente. El jefe de biblioteca envía el pedido correspondiente al Comité de Compras, quien con base en la disponibilidad presupuestal recomienda dicha compra. En cuanto a los criterios de selección del material bibliográfico, se realiza a discreción de los docentes y jefes de departamento, obviamente atendiendo a la bibliografía recomendada en los microcurrículos. Otro mecanismo utilizado es la presentación por parte del jefe de biblioteca de nuevas bases de datos, o de ampliación de las existentes o incluso de textos nuevos y revistas en papel La política institucional, ha llevado a disminuir la adquisición de revistas y textos en papel y al fortalecimiento y a la adquisición de nuevas bases de datos.', 'DECANA – DIRECTOR DE OTRAS DEPENDENCIAS  DIRECTOR BIBLIOTECA', 'Magnetico', 'centro de bibliotecas', '5', 'Hacer más funcional el Comité de Biblioteca', '7', '3', '399');
INSERT INTO `numericadocumental` VALUES ('360', 'Existe un grado medio de correspondencia entre la naturaleza y objetivos del programa, y la pertinencia, actualización y suficiencia del material bibliográfico con que cuenta el programa para apoyar el desarrollo de las distintas actividades académicas, debido a la transición de las políticas institucionales y al cambio generacional pero la tendencia general como política institucional es hacia el empleo de cada vez nuevas y mejores bases de datos', 'Decana, Coordinador de la Maestría', 'Magnetico', 'centro de bibliotecas', '4', 'Incentivar cada vez más el uso de las bases de datos', '7', '3', '400');
INSERT INTO `numericadocumental` VALUES ('361', 'Existe un alto grado de correspondencia entre la naturaleza y objetivos del programa, y la pertinencia, actualización y suficiencia de los recursos informáticos y de comunicación con que cuenta el programa para apoyar el desarrollo de las distintas actividades académicas evidenciado por la dotación y reposición de equipos de las salas de informática propia del programa que en total son cinco para una capacidad de cien (100) usuarios además de las otras con que cuenta la universidad', 'DECANA – CENTRO DE INFORMÁTICA – DIVISIÓN DE SISTEMAS', 'Magnetico', 'division de sistemas', '4', 'Continuar el plan de reposición y adquisición de recursos informáticos y de comunicación', '7', '3', '405');
INSERT INTO `numericadocumental` VALUES ('362', 'Existe un alto grado de correspondencia entre la cantidad de recursos informáticos y el número de docentes de la especialziacion, con una relación 1:1', 'DECANA – CENTRO DE INFORMÁTICA – DIVISIÓN DE SISTEMAS', 'Magnetico', 'division de sistemas', '4', 'Continuar el plan de reposición y adquisición de recursos informáticos y de comunicación', '7', '3', '406');
INSERT INTO `numericadocumental` VALUES ('363', 'Los criterios y políticas institucionales y del programa, en materia de adquisición y actualización de recursos informáticos y de comunicación, se encuentran consignados en: Plan de Desarrollo Institucional – en el Presupuesto de cada vigencia fiscal, también en el plan de desarrollo del programa', 'DECANA – CENTRO DE INFORMÁTICA – DIVISIÓN DE SISTEMAS', 'Magnetico', 'division de sistemas', '4', 'Continuar el plan de reposición y adquisición de recursos informáticos y de comunicación', '7', '3', '408');
