INSERT INTO `numericadocumental` VALUES ('367', 'La planeación y la ejecución de planes en materia de manejo de los recursos físicos y financieros, en concordancia con el tamaño y la complejidad de la institución y del programa, se encuentran en: Planes de desarrollo institucional y del programa, Planes de inversión del programa, presupuesto del programa, presupuesto por departamento, actas de consejo de facultad, académico y superior.', 'DECANA – JEFE DE PLANEACIÓN', 'Magnetico', 'oficina de planeacion', '4', 'Planeación, socializar más el monto de los recursos presupuestales', '7', '3', '417');
INSERT INTO `numericadocumental` VALUES ('368', 'Los  criterios y mecanismos para la elaboración, ejecución y seguimiento del presupuesto y para la asignación de recursos físicos y financieros para el programa se encuentran en el plan de desarrollo institucional, en el seguimiento semestral de las ejecuciones del plan de desarrollo por cada programa, en los  Informes de gestión semestral de la facultad, y en los informes de gestión de las diferentes dependencias de la Universidad. se publicita en carteleras', 'Coordinador de la especialziacion – JEFE DE PLANEACIÓN', 'Magnetico', 'division financiera', '5', 'Hacer valer el presupuesto del programa', '7', '3', '418');
