INSERT INTO `ponderacioncaracteristica` VALUES ('41', '8', '13', 'Los Objetivos se constituye en el norte, sin ella no se puede apreciar su operacionalización, tanto en los procesos académicos, como en los administrativos, ni el compromiso del programa de Medicina Interna con la calidad y con el entorno. Todos los estamentos deben conocer la razón de ser de la institución ', '7', '41');
INSERT INTO `ponderacioncaracteristica` VALUES ('42', '8', '4', 'La calidad de los estudiantes que ingresan, contribuye que el producto final sea de mayor calidad. Para alcanzar la función integral se necesita concordancia entre número de estudiantes y docentes. ', '7', '42');
INSERT INTO `ponderacioncaracteristica` VALUES ('43', '8', '4', 'Cuando la Institución admite al estudiante debe asumir mecanismos que garanticen completar su formación, hasta donde sea posible. Cada alumno que deserta le significa costos al Estado; por consiguiente, la institución debe evaluar la deserción investigando sus causas para aplicar los correctivos que la disminuyan. Puede ser un indicador de problemas en el proceso de formación o de la pertinencia del programa. ', '7', '43');
INSERT INTO `ponderacioncaracteristica` VALUES ('44', '8', '4', 'Nuestro objetivo está dirigida a la formación integral del egresado. Lo cual exige la existencia de estrategias para la formación integral. La formación integral es fundamental para el desarrollo de las competencias del ser. ', '7', '44');
INSERT INTO `ponderacioncaracteristica` VALUES ('45', '8', '2.5', 'La selección de docentes utilizando criterios académicos, presume una garantía para el desarrollo de una docencia de calidad y como resultado de la misma, un egresado altamente competitivo. El mecanismo de selección debe llevar a la vinculación de docentes con alto nivel de formación. ', '7', '45');
INSERT INTO `ponderacioncaracteristica` VALUES ('46', '7', '2.19', 'El estimulo a la docencia e investigación, que se le proporcione al docente por el ejercicio calificado de estas, contribuye al fortalecimiento de las mismas. Los estímulos se convierten en motivación para el mejoramiento de las características de la calidad del docente en el desarrollo de las funciones misionales del programa. ', '7', '46');
INSERT INTO `ponderacioncaracteristica` VALUES ('47', '7', '2.19', 'La interacción del tutor con el estudiante favorece el espacio de conocimiento, potenciando el desarrollo de las actividades académicas e investigativas, creando un ambiente de trabajo ameno para el desarrollo de la especialización ', '7', '47');
INSERT INTO `ponderacioncaracteristica` VALUES ('48', '10', '3.13', 'Toda institución debe tener una normatividad, que oriente su quehacer y regule la conducta de las personas que en ella conviven, a fin de garantizar el logro de su misión y una mejor convivencia en su colectividad. El estatuto profesoral establece derechos y deberes del ejercicio docente, otro factor garante de la calidad del proceso enseñanza aprendizaje. ', '7', '48');
INSERT INTO `ponderacioncaracteristica` VALUES ('49', '8', '3.25', 'Una de las funciones básicas de la educación superior es la investigación. El compromiso institucional y del programa frente al desarrollo del proceso misional de investigación determinará la calidad de la educación. Para ello, el programa debe contar con un núcleo de profesores y estudiantes que dedique tiempo significativo a la participación en Proyectos de investigación relacionados con el ámbito y con los objetivos del programa. ', '7', '49');
INSERT INTO `ponderacioncaracteristica` VALUES ('50', '8', '3.25', 'Para el efectivo aprendizaje autónomo del estudiante, se requiere el desarrollo de la capacidad de indagación y búsqueda de la información que le permita, además del desarrollo de un espíritu investigativo, potenciar en él, un pensamiento crítico y autónomo que favorezca la resolución de los diversos problemas que le presente su entorno. Por ello, es indispensable que el programa a través de las distintas asignaturas promueva la investigación formativa ', '7', '50');
INSERT INTO `ponderacioncaracteristica` VALUES ('51', '8', '3.25', 'La flexibilidad del plan de estudios para incorporar nuevos contenidos, para ajustarse al ritmo de aprendizaje del estudiante y para permitir la formación integral, es lo que dinamiza el currículo y garantiza una verdadera formación; de lo contrario, estaríamos en presencia de una profesionalización estática y obsoleta. ', '7', '51');
INSERT INTO `ponderacioncaracteristica` VALUES ('52', '8', '3.25', 'La evaluación periódica del programa permite la autorregulación del mismo, para ello es necesario que existan criterios claros y mecanismos que hagan viable dicha evaluación. Es importante para el mejoramiento continuo de la calidad del programa. ', '7', '52');
INSERT INTO `ponderacioncaracteristica` VALUES ('53', '8', '4.17', 'La investigación es una de las funciones básicas de la educación superior, permitiendo generar nuevos conocimientos, la articulación a nuestro programa permite el desarrollo de nuestra maestría, orientada al afianzamiento de los conocimientos y el desarrollo de nuevos saberes. ', '7', '53');
INSERT INTO `ponderacioncaracteristica` VALUES ('54', '8', '4.17', 'La estipulación de metas y planes estratégicos para la generación de nuevos conocimiento solo es posible con la orientación de grupos de trabajo que se enfoquen en el desarrollo de temáticas especificas. ', '7', '54');
INSERT INTO `ponderacioncaracteristica` VALUES ('55', '7', '3.65', 'Para el desarrollo de la especialización los temas de investigación deben generar un impacto positivo, permitiendo a la sociedad el avance, por la relevancia de las temáticas abordadas. El compromiso es continuo y otorga importancia al crecimiento cognitivo y su pertinencia con el medio donde se esta elaborando. ', '7', '55');
INSERT INTO `ponderacioncaracteristica` VALUES ('56', '8', '3.05', 'El Especialista en Medicina Interna tiene que interactuar con profesionales de otras áreas, por lo tanto, es importante se le capacite para trabajar en equipo. Los problemas de salud son multicausales, por consiguiente su abordaje debe ser desde diversas perspectivas. ', '7', '56');
INSERT INTO `ponderacioncaracteristica` VALUES ('57', '6', '2.29', 'Al identificarse y analizarse los problemas del entorno, la única manera de participar en su solución, es estableciendo mecanismos académicos y proyectando el programa a la comunidad, de lo contrario no sería posible participar en su solución y no se lograría uno de los procesos misionales del programa de medicina. Las investigaciones y actividades académicas deben ir dirigidas hacia la proyección y desarrollo social. ', '7', '57');
INSERT INTO `ponderacioncaracteristica` VALUES ('58', '7', '2.67', 'La especialización en medicina interna surge como respuesta a las necesidades del entorno, es así como se crea un vínculo permanente de alianza entre el entorno y la maestría que permite el crecimiento de ambos, y genera cambios continuos en el programa para ir dando respuesta a los cuestionamientos y necesidades del medio donde se desarrolla. ', '7', '58');
INSERT INTO `ponderacioncaracteristica` VALUES ('59', '2', '1', 'El avance vertiginoso que se da a nivel científico nos obliga, a la continua adaptación de nuestro plan curricular, para dar respuesta a los requerimientos internacionales, y así formar egresados con la capacidad de tener una visión mundial y actualizada de los conocimientos adquiridos y en desarrollo. ', '7', '59');
INSERT INTO `ponderacioncaracteristica` VALUES ('60', '6', '3', 'La relación de los estudiantes y docentes con la comunidad internacional, genera un compromiso institucional con el intercambio de conocimiento y el desarrollo mancomunado de las nuevas propuestas académicas mundiales. El contacto con miembros distinguidos y el promover la cooperación con instituciones y programas acreditados, favorecen su actualización y su mejoramiento continuo para lograr cada vez más niveles altos de calidad. ', '7', '60');
INSERT INTO `ponderacioncaracteristica` VALUES ('61', '2', '1', 'La interacción con la comunidad académica del orden internacional, favorece la investigación a partir del estado del arte en el tema y un aporte continúo al currículo que lo dinamiza. Las relaciones con instituciones de otros países contribuyen al logro de la visión del programa. ', '7', '61');
INSERT INTO `ponderacioncaracteristica` VALUES ('62', '7', '7', 'Los docentes, trabajadores administrativos y estudiantes, requieren de espacios en donde puedan desarrollar sus aptitudes artísticas, culturales y deportivas. De una u otra manera estas actividades influyen en el componente integral de toda la comunidad universitaria y en su realización. ', '7', '62');
INSERT INTO `ponderacioncaracteristica` VALUES ('63', '4', '4.89', 'Los egresados del programa son reconocidos por la calidad de la formación que reciben y se destacan por su desempeño en la disciplina, profesión, ocupación u oficio correspondiente. La calidad en el desempeño del egresado refleja la calidad en la formación que imparte el programa. ', '7', '63');
INSERT INTO `ponderacioncaracteristica` VALUES ('64', '5', '6.11', 'Los afianzamientos de nuestros egresados en la investigación y producción científica, permite que el profesional origine de manera continua nuevos conocimientos.', '7', '64');
INSERT INTO `ponderacioncaracteristica` VALUES ('65', '7', '1.75', 'La infraestructura aporta elementos importantes en el proceso de formación del estudiante. La planta física es fundamental para el desarrollo de las funciones de docencia, investigación y extensión, así como también para el desarrollo del bienestar. El tener un uso adecuado y un mantenimiento efectivo, contribuye a que las personas que la usan se sientan cómodas y realicen mejor su trabajo. ', '7', '65');
INSERT INTO `ponderacioncaracteristica` VALUES ('66', '8', '2', 'La existencia de bibliografía suficiente, accesible, adecuada y actualizada, garantiza un alto nivel de formación intelectual del estudiante, acorde con los avances tecnológicos, científicos y humanísticos del momento. Con la bibliografía actualizada, los conocimientos adquiridos están acordes con el momento en que se vive. Constituye un apoyo fundamental para el proceso docencia aprendizaje ', '7', '66');
INSERT INTO `ponderacioncaracteristica` VALUES ('67', '7', '1.75', 'La organización, administración y gestión, son elementos fundamentales para el logro de la misión del programa, debido a que es la administración la que puesta al servicio de la academia la hace posible ', '7', '67');
INSERT INTO `ponderacioncaracteristica` VALUES ('68', '7', '1.75', 'El disponer de recursos presupuestales en el programa, es fundamental para garantizar su desarrollo y funcionamiento. Si no se cuenta con los recursos mínimos adecuados, no sería posible el desarrollo de sus procesos misionales. ', '7', '68');
INSERT INTO `ponderacioncaracteristica` VALUES ('69', '7', '1.75', 'De nada serviría poseer los recursos físicos y financieros necesarios, si la administración de los mismos no es transparente, eficiente y eficaz y se ajuste a las normas legales. Una adecuada administración de los recursos permite el mejor aprovechamiento de los mismos y que se les dé un uso adecuado y racional, atendiendo las prioridades del programa. ', '7', '69');
INSERT INTO `ponderacioncaracteristica` VALUES ('70', '9.5', '3.54', 'Direccionamiento estratégico de la Universidad que orienta los procesos misionales', '8', '1');
INSERT INTO `ponderacioncaracteristica` VALUES ('71', '10', '3.73', 'Transpone los lineamientos estratégicos institucionales a los propósitos, metas y objetivos del programa.  ', '8', '2');
INSERT INTO `ponderacioncaracteristica` VALUES ('72', '10', '3.73', 'Responde a los problemas y necesidades del entorno', '8', '3');
INSERT INTO `ponderacioncaracteristica` VALUES ('73', '7.5', '2.95', 'Garantiza la calidad requerida para el desarrollo de los procesos académicos al interior del programa.', '8', '4');
INSERT INTO `ponderacioncaracteristica` VALUES ('74', '8.5', '3.34', 'Muestra la compatibilidad del número de estudiantes admitidos y la capacidad para su atención académica y administrativa', '8', '5');
INSERT INTO `ponderacioncaracteristica` VALUES ('75', '8', '3.15', 'Muestra la compatibilidad del número de estudiantes admitidos y la capacidad para su atención académica y administrativa', '8', '6');
INSERT INTO `ponderacioncaracteristica` VALUES ('76', '6.5', '2.56', 'Muestra la compatibilidad del número de estudiantes admitidos y la capacidad para su atención académica y administrativa', '8', '7');
INSERT INTO `ponderacioncaracteristica` VALUES ('77', '9', '1.71', 'Define los criterios de selección, vinculación y permanencia para el desarrollo de las funciones sustantivas del programa', '8', '8');
INSERT INTO `ponderacioncaracteristica` VALUES ('78', '8', '1.52', 'Define las reglas, normas, deberes y derechos de los docentes', '8', '9');
INSERT INTO `ponderacioncaracteristica` VALUES ('79', '9.5', '1.8', 'Capacidad profesoral para atender los requerimientos sustantivos del programa', '8', '10');
INSERT INTO `ponderacioncaracteristica` VALUES ('80', '9.5', '1.8', 'Garantiza los procesos de actualiza docente y  formación docente', '8', '11');
INSERT INTO `ponderacioncaracteristica` VALUES ('81', '8', '1.52', 'Genera procesos de motivación para el mejor desempeño de los docentes.', '8', '12');
INSERT INTO `ponderacioncaracteristica` VALUES ('82', '7', '1.33', 'Contribuye a la divulgación y visibilidad del de las actividades científicas', '8', '13');
INSERT INTO `ponderacioncaracteristica` VALUES ('83', '8.5', '1.61', 'Estimula y motiva el desempeño académico  del docente.', '8', '14');
INSERT INTO `ponderacioncaracteristica` VALUES ('84', '9', '1.71', 'Contribuye a la mejora continua de las actividades docentes.', '8', '15');
INSERT INTO `ponderacioncaracteristica` VALUES ('85', '10', '1.33', 'Garantiza los procesos de formación integral', '8', '16');
INSERT INTO `ponderacioncaracteristica` VALUES ('86', '9', '1.19', 'Permite la movilidad  y elección de su proceso de  formación académica ', '8', '17');
INSERT INTO `ponderacioncaracteristica` VALUES ('87', '9', '1.19', 'Permite la integralidad de su proceso de formación con otras disciplinas', '8', '18');
INSERT INTO `ponderacioncaracteristica` VALUES ('88', '9', '1.19', 'Define los métodos pedagógicos para el desarrollo de los procesos de aprendizajes', '8', '19');
INSERT INTO `ponderacioncaracteristica` VALUES ('89', '9.5', '1.26', 'Establece las políticas, normas y reglas claras para los procesos de evaluación ', '8', '20');
INSERT INTO `ponderacioncaracteristica` VALUES ('90', '9', '1.19', 'Contribuye al logro de los objetivos del programa y el desarrollo de las competencias', '8', '21');
INSERT INTO `ponderacioncaracteristica` VALUES ('91', '9.5', '1.26', 'Permite aplicar criterios y procedimientos para la evaluación periódica de los objetivos, procesos y logros del programa con miras a su mejoramiento continuo y a la innovación', '8', '22');
INSERT INTO `ponderacioncaracteristica` VALUES ('92', '9', '1.19', 'Muestra la influencia positiva del programa sobre su entorno', '8', '23');
INSERT INTO `ponderacioncaracteristica` VALUES ('93', '8', '1.06', 'Contribuye a los procesos de aprendizaje de los estudiantes', '8', '24');
INSERT INTO `ponderacioncaracteristica` VALUES ('94', '8', '1.06', 'Contribuye a los procesos de aprendizaje de los estudiantes y gestión del programa', '8', '25');
INSERT INTO `ponderacioncaracteristica` VALUES ('95', '8', '1.06', 'Proporciona las herramientas didácticas para la implementación del currículo', '8', '26');
INSERT INTO `ponderacioncaracteristica` VALUES ('96', '8', '3.5', 'Genera la visibilidad y el impacto del programa en los ámbitos local, nacional e internacional', '8', '27');
INSERT INTO `ponderacioncaracteristica` VALUES ('97', '8', '3.5', 'Genera la visibilidad y el impacto del programa en los ámbitos local, nacional e internacional', '8', '28');
INSERT INTO `ponderacioncaracteristica` VALUES ('98', '9', '6', 'Promueve el espíritu crítico y competencias científicas, culturales y artísticas de los estudiantes', '8', '29');
INSERT INTO `ponderacioncaracteristica` VALUES ('99', '9', '6', 'Garantiza el recurso humano y financiero para el desarrollo de las competencias científicas, culturales y artísticas de los estudiantes.', '8', '30');
INSERT INTO `ponderacioncaracteristica` VALUES ('100', '7', '3.16', 'Contribuye al desarrollo de las condiciones de vida de la comunidad académica', '8', '31');
INSERT INTO `ponderacioncaracteristica` VALUES ('101', '8.5', '3.84', 'Define la eficacia del programa desde el punto de vista del cumplimiento de sus objetivos', '8', '32');
INSERT INTO `ponderacioncaracteristica` VALUES ('102', '9', '2.67', 'Articulan las funciones sustantivas para su mejor desempeño', '8', '33');
INSERT INTO `ponderacioncaracteristica` VALUES ('103', '8', '2.37', 'Facilita la interacción  para su mejor desempeño entre los diferentes estamentos al interior del programa y la Universidad ', '8', '34');
INSERT INTO `ponderacioncaracteristica` VALUES ('104', '10', '2.96', 'Permite el liderazgo y la gestión del programa en el desarrollo de sus funciones sustantivas', '8', '35');
INSERT INTO `ponderacioncaracteristica` VALUES ('105', '8', '4.71', 'Proporciona información en asuntos concernientes al logro de los fines de la institución y el programa', '8', '36');
INSERT INTO `ponderacioncaracteristica` VALUES ('106', '9', '5.29', 'Mide el aporte del programa a través de sus egresados a los problemas y necesidades del entorno', '8', '37');
INSERT INTO `ponderacioncaracteristica` VALUES ('107', '7', '1.96', 'Representa las necesidades de infraestructura, adecuada, suficiente y bien mantenida para el desarrollo de las funciones sustantivas', '8', '38');
INSERT INTO `ponderacioncaracteristica` VALUES ('108', '9', '2.52', 'Representa los requerimientos de recursos suficientes para funcionamiento e inversión del  programa', '8', '39');
INSERT INTO `ponderacioncaracteristica` VALUES ('109', '9', '2.52', 'Representa la eficiencia, eficacia y transparencia en la administración de los recursos físicos y financieros del programa', '8', '40');
INSERT INTO `ponderacioncaracteristica` VALUES ('110', '9', '13', 'El programa está dirigido hacia el cumplimiento de los objetivos trazados, convirtiéndose en la meta, ya que permite apreciar su operacionalización, tanto en los procesos académicos, los administrativos y en el compromiso del programa con la calidad y con el entorno, por lo cual todos los miembros del programa deben estar comprometidos con el cumplimiento de estos.', '5', '41');
INSERT INTO `ponderacioncaracteristica` VALUES ('111', '8', '4', 'La adecuada evaluación de las características de los estudiantes al momento de su ingreso garantiza en gran medida la calidad requerida para el desarrollo de los procesos académicos al interior del programa.', '5', '42');
INSERT INTO `ponderacioncaracteristica` VALUES ('112', '9', '4.5', 'El objetivo primordial de este componente consiste en facilitar el tránsito del estudiante a lo largo del programa de estudios, garantizando su egreso exitoso y su graduación efectiva. Por tanto, todas las dimensiones deben dirigirse a ofrecer al estudiante lo que requiere, tanto física, mental, social y espiritualmente, para ser un estudiante con desempeño de calidad conducente a su graduación y ejercicio profesional. Este objetivo se logra cuando las IES concentran su acción efectiva en las tres dimensiones del modelo.', '5', '43');
INSERT INTO `ponderacioncaracteristica` VALUES ('113', '7', '3.5', 'En los graduados se representa el cumplimiento de los objetivos del programa, al egresar especialistas integrales, capaces de integrarse a la comunidad productiva con aportes que enriquezcan el desarrollo de la especialidad en el medio en el que se desenvuelven.', '5', '44');
INSERT INTO `ponderacioncaracteristica` VALUES ('114', '8', '2.84', 'La escogencia de los profesores en un determinado programa, debe ir en correspondencia con los objetivos académicos de dicho programa. Al contar con una planta de profesores con un perfil académico y ético que se ajusta por su formación y características al desarrollo de prácticas formativas, se presume una garantía para el desarrollo de una docencia de calidad y como resultado de la misma, un egresado altamente competitivo. ', '5', '45');
INSERT INTO `ponderacioncaracteristica` VALUES ('115', '7', '2.48', 'Los profesores, quienes son acompañantes y vigías del proceso de formación de los estudiantes, deben estar en constante búsqueda del conocimiento, así como promover la socialización de éste en beneficio de la comunidad, con el fin de demostrar que su perfil se ajusta a las necesidades formativas del estudiante de posgrado.', '5', '46');
INSERT INTO `ponderacioncaracteristica` VALUES ('116', '9', '3.19', 'La interacción del tutor con el estudiante favorece el espacio de conocimiento, potenciando el desarrollo de las actividades académicas e investigativas, creando un ambiente de trabajo de bienestar para el desarrollo del proceso formativo.', '5', '47');
INSERT INTO `ponderacioncaracteristica` VALUES ('117', '7', '2.48', 'Las políticas sobre el desarrollo docente en toda institución deben ser claras y estar reglamentadas dentro de un estatuto que brinde garantías al momento de la selección de estos, contratación y evaluación de su actividad, tanto para el adecuado desarrollo profesional de los profesores, el ejercicio de la docencia y el beneficio del estudiante.', '5', '48');
INSERT INTO `ponderacioncaracteristica` VALUES ('118', '9', '3', 'El estudiante de posgrado requiere una formación avanzada con énfasis en la investigación, necesitando para su formación el desarrollo de competencias básicas de investigación mediante estrategias propias de cada campo de conocimiento, siempre bajo la guía de un tutor (docente), tales como la capacidad de indagación, el pensamiento autónomo y dominio técnicas de investigación, capacidad construir estados del arte y tendencias, así como también la capacidad de comunicación de resultados investigación. ', '5', '49');
INSERT INTO `ponderacioncaracteristica` VALUES ('119', '8', '2.67', 'Una de las principales características que se estimula en la formación del estudiante de Urología es su integralidad, por lo cual su labor de generación de conocimiento no puede ser ajena a las condiciones actuales tanto sociales, políticas y medioambientales del medio donde se desenvuelve, con el fin de identificar las necesidades de desarrollo en áreas específicas y así forjar un conocimiento útil y productivo para la sociedad.', '5', '50');
INSERT INTO `ponderacioncaracteristica` VALUES ('120', '9', '3', 'Un plan de estudios debe estar diseñado con una flexibilidad tal que permita una formación unificada en sus estudiantes, pero que a la vez admita escoger entre opciones de profundización en diferentes temas o líneas de investigación dentro de la misma institución o en convenio con otras, para que se facilite, promueva y garantice la movilidad de estudiantes y profesores y así ajustarse al ritmo del conocimiento moderno.', '5', '51');
INSERT INTO `ponderacioncaracteristica` VALUES ('121', '7', '2.33', 'La calidad de un programa se asegura a través de los procesos periódicos de autoevaluación, así como también el seguimiento de estos resultados en busca de planes de mejoramiento continuo, dentro del cual juegan un papel principal todas las instancias involucradas como son los estudiantes, profesores, directivos y personal técnico y administrativo.', '5', '52');
INSERT INTO `ponderacioncaracteristica` VALUES ('122', '7', '3.18', 'En los programas de posgrado la investigación se consolida en la actualidad como la base para su desarrollo, por lo cual es de fundamental importancia velar por el desarrollo de competencias mediante estrategias reglamentadas en las políticas de investigación, las cuales deben ser diseñadas por la institución educativa donde el programa se encuentre y de esta manera garantizar la articulación de la investigación como pieza clave en el programa.', '5', '53');
INSERT INTO `ponderacioncaracteristica` VALUES ('123', '7', '3.18', 'El desarrollo de la investigación dentro de un programa sólo se puede dar dentro de una organización que permita integrar dentro de grupos y líneas específicas a los sujetos (docentes y estudiantes) con ideas dentro de una misma área del conocimiento, facilitando la ayuda mutua, el desarrollo de proyectos y trabajos, búsqueda de financiación y la socialización de sus resultados a la comunidad mediante el aval de una sociedad científica.', '5', '54');
INSERT INTO `ponderacioncaracteristica` VALUES ('124', '8', '3.64', 'El objetivo de generar competencias de investigación en los estudiantes del programa se basa en el compromiso que tenemos con la comunidad de brindar conocimiento y tecnologías que mejoren la salud, por tanto el impacto de los productos de la investigación debe ser concebido de acuerdo al reconocimiento de la comunidad científica y al beneficio que este le brinde a la población.', '5', '55');
INSERT INTO `ponderacioncaracteristica` VALUES ('125', '8', '2.78', 'El estudiante del programa de Urología se concibe como un ser integral, el cual no puede limitar su formación a un área específica del saber, siendo importante para su desarrollo el contar con la posibilidad de tomar seminarios o cursos en campos complementarios a los del programa, ya sea en la universidad o en otras universidades, participar en las actividades de otros grupos de investigación e interactuar con docentes de otras universidades o diferentes áreas, esto con el fin de valorar otras perspectivas que serán de utilidad en el desempeño de un egresado competitivo.', '5', '56');
INSERT INTO `ponderacioncaracteristica` VALUES ('126', '7', '2.43', 'Parte de la pertinencia de la existencia de un programa de posgrado se fundamenta en los aportes que sus estudiantes y egresados brinden a la comunidad. Por tanto, los trabajos investigativos deben estar diseñados siempre con un componente social que permita innovaciones tecnológicas, sociales y culturales con un impacto positivo para el entorno.', '5', '57');
INSERT INTO `ponderacioncaracteristica` VALUES ('127', '8', '2.78', 'Durante el proceso de formación, el estudiante del programa de Urología debe ser consciente de los problemas o desafíos que se enfrentan a nivel local, nacional o global de manera que le permita interactuar con el entorno y generar programas de promoción y prevención y terapéuticas de intervención temprana, generando lazos entre ambos que permite el crecimiento. ', '5', '58');
INSERT INTO `ponderacioncaracteristica` VALUES ('128', '8', '2.33', 'La formación de profesionales al nivel de maestrías y doctorados requiere el desarrollo de una capacidad para insertarse en la ciencia global y formar parte activa de redes de investigación a nivel regional y mundial, por lo cual es importante para el estudiante el dominio de al menos una segunda lengua y contar con la opción de pasantías en universidades extranjeras.', '5', '59');
INSERT INTO `ponderacioncaracteristica` VALUES ('129', '8', '2.33', 'La relación de los estudiantes y docentes con la comunidad internacional, genera un compromiso institucional con el intercambio de conocimiento y el desarrollo mancomunado de las nuevas propuestas académicas mundiales. El contacto con miembros distinguidos y el promover la cooperación con instituciones y programas acreditados, favorecen su actualización y su mejoramiento continuo para lograr cada vez más niveles altos de calidad.', '5', '60');
INSERT INTO `ponderacioncaracteristica` VALUES ('130', '8', '2.33', 'La interacción con la comunidad académica del orden internacional, favorece la investigación a partir del estado del arte en el tema y un aporte continúo al currículo que lo dinamiza. Las relaciones con instituciones de otros países contribuyen al logro de la visión del programa.', '5', '61');
INSERT INTO `ponderacioncaracteristica` VALUES ('131', '8', '7', 'Los docentes, estudiantes, directivos y administrativos, necesitan para el óptimo desarrollo del programa, condiciones mínimas de bienestar que garanticen una labor de calidad, este bienestar representado desde salud, vivienda digna, alimentación, apoyo psicológico y escenarios de esparcimiento, así como también el apoyo institucional en la asistencia a eventos académicos propios del programa.', '5', '62');
INSERT INTO `ponderacioncaracteristica` VALUES ('132', '7', '5.13', 'La calidad del programa se ve reflejada en gran manera en el desempeño laboral y académico de sus egresados, el cual puede ser valorado a través del impacto que sus aportes generan en  la comunidad.', '5', '63');
INSERT INTO `ponderacioncaracteristica` VALUES ('133', '8', '5.87', 'Los afianzamientos de nuestros egresados en la investigación y producción científica, permite que el profesional origine de manera continua nuevos conocimientos generando así un impacto positivo en el entorno.', '5', '64');
INSERT INTO `ponderacioncaracteristica` VALUES ('134', '8', '1.95', 'La infraestructura aporta elementos importantes en el proceso de formación del estudiante. La planta física es fundamental para el desarrollo de las funciones de docencia, investigación y extensión, así como también la presencia de medios audiovisuales y tecnologías médicas que le permitan al estudiante ir a la altura de la urología moderna. El tener un uso adecuado y un mantenimiento efectivo, contribuye a que las personas que la usan se sientan cómodas y realicen mejor su trabajo.', '5', '65');
INSERT INTO `ponderacioncaracteristica` VALUES ('135', '9', '2.2', 'La existencia de bibliografía suficiente, accesible, adecuada y actualizada, garantiza un alto nivel de formación intelectual del estudiante, acorde con los avances tecnológicos, científicos y humanísticos del momento. Con la bibliografía actualizada, los conocimientos adquiridos están acordes con el momento en que se vive. Constituye un apoyo fundamental para el proceso docencia aprendizaje.', '5', '66');
INSERT INTO `ponderacioncaracteristica` VALUES ('136', '9', '2.2', 'La organización, administración y gestión, son elementos fundamentales para el logro de la misión del programa, debido a que es la administración la que puesta al servicio de la academia la hace posible.', '5', '67');
INSERT INTO `ponderacioncaracteristica` VALUES ('137', '7', '1.71', 'El disponer de recursos presupuestales en el programa, es fundamental para garantizar su desarrollo y funcionamiento. Si no se cuenta con los recursos mínimos adecuados, no sería posible el desarrollo de sus procesos misionales.', '5', '68');
INSERT INTO `ponderacioncaracteristica` VALUES ('138', '8', '1.95', 'De nada serviría poseer los recursos físicos y financieros necesarios, si la administración de los mismos no es transparente, eficiente y eficaz y se ajuste a las normas legales. Una adecuada administración de los recursos permite el mejor aprovechamiento de los mismos y que se les dé un uso adecuado y racional, atendiendo las prioridades del programa.', '5', '69');
INSERT INTO `ponderacioncaracteristica` VALUES ('139', '8', '3.83', 'La misión y la visión institucional son los referentes naturales y se incorporan en los principios de formación del programa. El proyecto educativo institucional sirve como punto de partida y orienta las políticas académicas y administrativas del programa. ', '9', '1');
INSERT INTO `ponderacioncaracteristica` VALUES ('140', '8', '3.83', 'El PEP y el PEI son el punto de encuentro de las políticas institucionales y Las políticas del programa ', '9', '2');
INSERT INTO `ponderacioncaracteristica` VALUES ('141', '7', '3.35', 'El programa debe contribuir a las condiciones sociales de su entorno. ', '9', '3');
INSERT INTO `ponderacioncaracteristica` VALUES ('142', '8', '2.96', 'La institución cuenta con políticas bien establecidas para el ingreso de los estudiantes al programa. ', '9', '4');
INSERT INTO `ponderacioncaracteristica` VALUES ('143', '5', '1.85', 'La universidad tiene la capacidad para asegurar las condiciones de calidad necesarias para el número de estudiantes admitidos lo cual contribuye a mejorar la calidad. ', '9', '5');
INSERT INTO `ponderacioncaracteristica` VALUES ('144', '6', '2.22', 'La formación integral es fundamental para el desarrollo de las competencias del ser. ', '9', '6');
INSERT INTO `ponderacioncaracteristica` VALUES ('145', '8', '2.96', 'El conocimiento de las normas que reglamentan la interacción entre la institución y los estudiantes garantizan una mejor convivencia. ', '9', '7');
INSERT INTO `ponderacioncaracteristica` VALUES ('146', '8', '1.36', 'La selección de profesores por méritos académicos debe llevar a la vinculación de docentes con alto nivel de formación. ', '9', '8');
INSERT INTO `ponderacioncaracteristica` VALUES ('147', '8', '1.36', 'La institución cuenta con un estatuto del profesor donde expone claramente sus derechos y deberes lo cual influye en la calidad del proceso enseñanza aprendizaje. ', '9', '9');
INSERT INTO `ponderacioncaracteristica` VALUES ('148', '7', '1.19', 'El número de docentes, su nivel de formación y el tiempo dedicado a las actividades del programa ejercen influencia en la calidad del estudiante y del egresado ', '9', '10');
INSERT INTO `ponderacioncaracteristica` VALUES ('149', '8', '1.36', 'La institución tiene políticas y programas de desarrollo para la formación de los profesores lo cual contribuye al logro de la visión y la misión ', '9', '11');
INSERT INTO `ponderacioncaracteristica` VALUES ('150', '8', '1.36', 'Los estímulos se convierten en motivación para el mejoramiento de las características de calidad del docente en el desarrollo de las funciones sustantivas. ', '9', '12');
INSERT INTO `ponderacioncaracteristica` VALUES ('151', '6', '1.02', 'La producción de material docente evidencia el desarrollo del docente y su compromiso en la mejora del los procesos académicos. ', '9', '13');
INSERT INTO `ponderacioncaracteristica` VALUES ('152', '7', '1.19', 'La remuneración que reciben los docentes es acorde con su formación lo cual es un estímulo para que mejoren su desempeño. ', '9', '14');
INSERT INTO `ponderacioncaracteristica` VALUES ('153', '7', '1.19', 'La evaluación de profesores permite mejorar las funciones de docencia e investigación que conllevan a constituir un programa de calidad. ', '9', '15');
INSERT INTO `ponderacioncaracteristica` VALUES ('154', '6', '0.81', 'El currículo del programa está diseñado para formar un estudiante integral que se desenvuelva satisfactoriamente en su campo laboral. ', '9', '16');
INSERT INTO `ponderacioncaracteristica` VALUES ('155', '7', '0.95', 'El programa tiene un currículo flexible de acuerdo con los parámetros exigidos de flexibilidad el cual facilita la incorporación de elementos de formación integral. ', '9', '17');
INSERT INTO `ponderacioncaracteristica` VALUES ('156', '6', '0.81', 'El programa contempla asignaturas electivas fundamentadas específicamente en la interdisciplinariedad. ', '9', '18');
INSERT INTO `ponderacioncaracteristica` VALUES ('157', '5', '0.68', 'Las metodologías de enseñanzas deben ser coherentes con las competencias esperadas, a fin de lograr un aprendizaje significativo. ', '9', '19');
INSERT INTO `ponderacioncaracteristica` VALUES ('158', '5', '0.68', 'Los parámetros de evaluación deben ser claros y equitativos y deben ser coherentes con la naturaleza de las actividades académicas del programa. ', '9', '20');
INSERT INTO `ponderacioncaracteristica` VALUES ('159', '7', '0.95', 'Los trabajos de los estudiantes se aplican de tal manera que se cumpla el logro de los objetivos y competencias del programa. ', '9', '21');
INSERT INTO `ponderacioncaracteristica` VALUES ('160', '8', '1.08', 'La autorregulación y evaluación del programa es importante para determinar la calidad del mismo. ', '9', '22');
INSERT INTO `ponderacioncaracteristica` VALUES ('161', '8', '1.08', 'La interacción con la comunidad, permite detectar áreas sensibles en las cuales se necesita ayuda, diseñar estrategias para mejorarlas e incorporarlas a los procesos curriculares. ', '9', '23');
INSERT INTO `ponderacioncaracteristica` VALUES ('162', '8', '1.08', 'Son fundamentales para el acompañamiento de la enseñanza.', '9', '24');
INSERT INTO `ponderacioncaracteristica` VALUES ('163', '8', '1.08', 'Los recursos informáticos y de comunicación complementan la actividad académica y facilitan la interacción con otras comunidades.', '9', '25');
INSERT INTO `ponderacioncaracteristica` VALUES ('164', '6', '0.81', 'Los recursos de apoyo docente facilitan el desarrollo de los planes curriculares y ayudan a incorporar las experiencias en el proceso de enseñanza. ', '9', '26');
INSERT INTO `ponderacioncaracteristica` VALUES ('165', '6', '4.15', 'El programa toma como referencia para su plan de estudios el estado del arte de las comunidades nacionales e internacionales. ', '9', '27');
INSERT INTO `ponderacioncaracteristica` VALUES ('166', '7', '4.85', 'Algunos profesores tienen interacción con comunidades académicas nacionales e internacionales, la presencia institucional es fundamental para el fortalecimiento de las mismas. ', '9', '28');
INSERT INTO `ponderacioncaracteristica` VALUES ('167', '6', '4.62', 'La vinculación de los estudiantes a los grupos de investigación existentes y al desarrollo de eventos en el programa es un factor determinante para su formación en el quehacer científico. ', '9', '29');
INSERT INTO `ponderacioncaracteristica` VALUES ('168', '7', '5.38', 'El compromiso institucional y del programa frente al desarrollo de la función investigativa determinara la calidad del mismo. ', '9', '30');
INSERT INTO `ponderacioncaracteristica` VALUES ('169', '8', '5.87', 'Los programas de Bienestar favorecen la retención de estudiantes y la formación integral de la comunidad estudiantil. ', '9', '31');
INSERT INTO `ponderacioncaracteristica` VALUES ('170', '7', '5.13', 'Dentro de los programas de Bienestar estudiantil se tiene uno de gran importancia dedicado a la permanencia y retención, debido a que la deserción puede ser un indicador de problemas en el proceso de formación o de la pertinencia del programa.', '9', '32');
INSERT INTO `ponderacioncaracteristica` VALUES ('171', '7', '3.04', 'El nivel de organización administrativo es fundamental para el éxito de la gestión de la institución y del programa.', '9', '33');
INSERT INTO `ponderacioncaracteristica` VALUES ('172', '8', '3.48', 'El flujo correcto de la información garantiza la ejecución oportuna de las actividades que llevan a una correcta toma de decisiones. ', '9', '34');
INSERT INTO `ponderacioncaracteristica` VALUES ('173', '8', '3.48', 'Establece las directrices para el desarrollo del proceso académico administrativo. ', '9', '35');
INSERT INTO `ponderacioncaracteristica` VALUES ('174', '8', '6', 'El conocimiento del desempeño de los egresados en la comunidad sirve como retroalimentación en los procesos de ajuste curricular. ', '9', '36');
INSERT INTO `ponderacioncaracteristica` VALUES ('175', '8', '6', 'Un impacto positivo de los egresados en el medio indica que son competentes y el programa cumple con su función sustantiva de formación. ', '9', '37');
INSERT INTO `ponderacioncaracteristica` VALUES ('176', '5', '1.84', 'La infraestructura física es un elemento importante en el proceso de formación del estudiante y los recursos financieros deben garantizar los medios para lograrla. ', '9', '38');
INSERT INTO `ponderacioncaracteristica` VALUES ('177', '7', '2.58', 'La disponibilidad presupuestal influye en el desarrollo del programa, y la participación en la elaboración del mismo incide en la distribución equitativa y suficiencia de los recursos. ', '9', '39');
INSERT INTO `ponderacioncaracteristica` VALUES ('178', '7', '2.58', 'Una adecuada administración de los recursos permite un mejor aprovechamiento de los mismos. ', '9', '40');
INSERT INTO `ponderacioncaracteristica` VALUES ('179', '10', '2.29', 'La misión de la universidad es el reflejo holístico del deber ser del Programa de especialización en Ciencias Penales y Criminológicas, a partir de los criterios de coherencia, transparencia, integridad, responsabilidad y universalidad del Programa, la ponderación dada a esta característica es la de la excelencia. ', '12', '114');
INSERT INTO `ponderacioncaracteristica` VALUES ('180', '8', '1.83', 'El Proyecto institucional condiciona el desarrollo funcional, educativo y administrativos del Programa, la valoración dada se ajusta a la realidad deseada en el Programa.', '12', '115');
INSERT INTO `ponderacioncaracteristica` VALUES ('181', '8', '1.83', 'El Proyecto Educativo del Programa de especialización en Ciencias Penales y Criminológicas se refleja en la calidad académica del mismo, pues las políticas curriculares, así como sus objetivos estructurales, están en consonancia con el  especialista que egresa de nuestra institución.', '12', '116');
INSERT INTO `ponderacioncaracteristica` VALUES ('182', '9', '2.06', 'La pertinencia social del programa está formada a partir de las exigencias académicas locales, nacionales e internacionales, el cual responde al contexto social donde se desarrolla.', '12', '117');
INSERT INTO `ponderacioncaracteristica` VALUES ('183', '8.5', '2.29', 'Los mecanismos de admisión de los estudiantes del Programa de especialización en Ciencias Penales y Criminológicas, están provistos de principios de equidad y vías de transparencia y universalidad, los cuales son soportados por las directrices institucionales y la política de calidad académica y administrativa.', '12', '118');
INSERT INTO `ponderacioncaracteristica` VALUES ('184', '10', '2.7', 'La calidad académica de los estudiantes de la especialización en Ciencias Penales y Criminológicas, la cual es promovida por la Universidad mediante el desarrollo personal, académico y profesional, el cual se vea  reflejado como una experiencia de alta calidad. Como egresado de la Universidad de Cartagena, el estudiante debe desarrollar sus estudios dentro de un escenario y ambiente con todas las condiciones académicas para alcanzar la calidad esperada.', '12', '119');
INSERT INTO `ponderacioncaracteristica` VALUES ('185', '8', '2.16', 'Una estrategia que permita rastrear el nivel de deserción independiente del tiempo, permite valorar y velar por la calidad académica, apuntando a un trabajo eficaz y eficiente.', '12', '120');
INSERT INTO `ponderacioncaracteristica` VALUES ('186', '9', '2.43', 'La participación en actividades académicas, investigativas, deportivas, culturales y artísticas, es para el estudiante de la especialización en Ciencias penales y criminológicas de la Universidad de Cartagena necesaria para el verdadero desarrollo personal, profesional, cultural y ético.', '12', '121');
INSERT INTO `ponderacioncaracteristica` VALUES ('187', '9', '2.43', 'El Reglamento Estudiantil, es de suma importancia, pues en él se reflejan los derechos, garantías y deberes que tiene el estudiante para el pleno desarrollo de sus estudios en la Institución, el cual permita afianzar proceso de enseñanza-aprendizaje en la Universidad.', '12', '122');
INSERT INTO `ponderacioncaracteristica` VALUES ('188', '9', '1.8', 'Del adecuado proceso de selección y vinculación de los docentes, se determina el logro de la Misión y objetivos del Programa, luego la selección se debe hacer de acuerdo a su naturaleza académica y a la calidad exigida para obtener la excelencia académica.', '12', '123');
INSERT INTO `ponderacioncaracteristica` VALUES ('189', '10', '2', 'El estatuto profesoral de la Universidad de Cartagena, está proyectado a mantener la igualdad de condiciones al interior de los Programas académicos, de tal manera que quienes lo aplican lo deben  hacer con equidad, transparencias y responsabilidad.', '12', '124');
INSERT INTO `ponderacioncaracteristica` VALUES ('190', '10', '2', 'Esta característica es de suma importancia, pues un cuerpo docente cualificado permite el desarrollo de los procesos académicos y administrativos dentro del Programa, los cuales al tener la preparación requerida ayudarán al logro de la Misión Institucional y del Programa.', '12', '125');
INSERT INTO `ponderacioncaracteristica` VALUES ('191', '8', '1.6', 'La necesidad de una política Institucional y del Programa para el desarrollo profesoral es determinante para el logro de los objetivos institucionales para el crecimiento y desarrollo de los profesores.', '12', '126');
INSERT INTO `ponderacioncaracteristica` VALUES ('192', '9', '1.8', 'los procesos académicos desarrollados con  las distintas comunidades académicas locales, regionales, nacionales e internacionales, permiten que nuestros egresados puedan desempeñarse con competitividad en cualquier contexto, así como mantener una dinámica curricular actualizada.', '12', '127');
INSERT INTO `ponderacioncaracteristica` VALUES ('193', '8', '1.6', 'Las directrices definidas en cuanto a los estímulos  a la docencia, a la investigación, extensión y proyección social y la cooperación internacional, permiten que en el Programa pueda fomentarse la participación de los diferentes estamentos para reconocer el ejercicio certificado de las funciones sustantivas.', '12', '128');
INSERT INTO `ponderacioncaracteristica` VALUES ('194', '8', '1.6', 'Es necesario apoyar la producción de material docentes mediante el amparo de unas políticas  institucional para generar una actividad docente, dinámica, creativa y oportuna.', '12', '129');
INSERT INTO `ponderacioncaracteristica` VALUES ('195', '8', '1.6', 'El adecuado  reconocimiento de los méritos de los profesores permite incentivarlos en su quehacer y fomentar en ellos el seguir creciendo y buscando nuevos conocimientos, así como la construcción de estrategias que permitan cualificar las directrices institucionales', '12', '130');
INSERT INTO `ponderacioncaracteristica` VALUES ('196', '10', '1.18', 'El marco teórico y práctico a partir de un modelo de ciencia penal integral (Derecho Penal - Teoría del Delito – Criminología), influye de forma directa y preponderante en la formación del especialista, pues esta, contenida en el currículo, posibilita un conocimiento propio y especifico de la profesión, soportado también en una formación ética e integral. ', '12', '131');
INSERT INTO `ponderacioncaracteristica` VALUES ('197', '7', '0.82', 'El Programa de especialización en Ciencias Penales y Criminológicas de la Universidad de Cartagena, debe contribuir con la flexibilidad de su estructura curricular para dar respuesta  a los cambios y necesidades que se presenten en el entorno. Toda vez que la Universidad prepara al estudiante para servir a la sociedad, la actividad responsable de preparación debe considerar el hecho de que esa sociedad es dinámica de acuerdo a las exigencias políticas, sociales y jurídicas. ', '12', '132');
INSERT INTO `ponderacioncaracteristica` VALUES ('198', '8', '0.94', 'La interdisciplinariedad planteada por el programa de especialización se proyecta como una propuesta que integra los fundamentos constitucionales del derecho penal, los esquemas teóricos del delito, herramientas para una política criminal dentro del modelo de Estado Social y Democrático de Derecho, soportes que contribuyen a que el estudiante reconozca su rol y los espacios de las otras profesiones afines.', '12', '133');
INSERT INTO `ponderacioncaracteristica` VALUES ('199', '8', '0.94', 'Dentro de las concepciones modernas hay que tener en cuenta la que se refiere a la globalización del estudio del Derecho penal, por tanto el Programa de especialización en Ciencias penales y Criminológicas de la Universidad de Cartagena, debe estar inmerso dentro del debate nacional e internacional, lo que hace necesario que los estudiantes adquieran las competencias jurídicas que le permitan desenvolverse en el entorno jurídico de estos espacios.', '12', '134');
INSERT INTO `ponderacioncaracteristica` VALUES ('200', '9', '1.06', 'Teniendo en cuenta la naturaleza del programa y con el fin de dar cumplimiento al perfil que debe poseer el egresado, el desarrollo del programa de Especialización en Ciencias Penales y Criminológicas tendrá como estrategia pedagógica principal la combinación de la profundización conceptual con la aplicación de la misma, orientada en mayor medida al trabajo y práctica del propio estudiante', '12', '135');
INSERT INTO `ponderacioncaracteristica` VALUES ('201', '7.5', '0.88', 'El sistema de evaluación del Programa debe responder a las políticas y reglas claras y universales de evaluación, posibilitando a los estudiantes el logro del perfil, acorde con las competencias especificadas en los objetivos y metas del currículo.', '12', '136');
INSERT INTO `ponderacioncaracteristica` VALUES ('202', '8.5', '1', 'Los trabajos se constituyen en una actividad pedagógica idónea que permite el desarrollo de las competencias propias de las ciencias penales y criminológicas, inmersas en la estructura curricular del Programa ', '12', '137');
INSERT INTO `ponderacioncaracteristica` VALUES ('203', '8', '0.94', 'La evaluación y la autorregulación del Programa de especialización en Ciencias Penales y criminológicas de la Universidad de Cartagena se constituyen en el eje principal para el mejoramiento continuo del mismo a través de la detección de sus fortalezas y debilidades.', '12', '138');
INSERT INTO `ponderacioncaracteristica` VALUES ('204', '9', '1.06', 'La estrecha relación que guarda con la misión del programa de especialización en Ciencias Penales y Criminológicas, obliga a que el proceso de formación en investigación proyecte al estudiante una posición crítica frente a los fenómenos sociales, económicos y políticos, en el cual se desenvuelve el especialista, para así buscar soluciones a los problemas y necesidades del entorno.', '12', '139');
INSERT INTO `ponderacioncaracteristica` VALUES ('205', '9', '1.06', 'El Programa debe contar con políticas institucionales que faciliten el fomento de la investigación y su interrelación con la docencia y la proyección social, para la solución de problemas del entorno donde se desenvuelve el especialista.', '12', '140');
INSERT INTO `ponderacioncaracteristica` VALUES ('206', '9', '1.06', 'La Universidad de Cartagena debe promover en la formación académica de los estudiantes del Programa de especialización en ciencias penales y criminológicas, el diagnóstico y solución de problemas sociales y nutrirse de la experiencia que la sociedad genera en su dinámica propia.', '12', '141');
INSERT INTO `ponderacioncaracteristica` VALUES ('207', '9', '1.06', 'El recurso bibliográfico se constituye en el componente sustancial para introducir a los estudiantes en el conocimiento del derecho penal, por tanto el Programa de especialización en ciencias penales y criminológicas de la Universidad de Cartagena debe contar con adecuados y suficientes recursos bibliográficos.', '12', '142');
INSERT INTO `ponderacioncaracteristica` VALUES ('208', '9', '1.06', 'La sociedad global del conocimiento en la que desenvuelven los sujetos dedicados al estudio del derecho penal como modelo de ciencia integral amerita que cuente con las herramientas informáticas y tecnológicas suficientes para el desarrollo de sus propios lineamientos', '12', '143');
INSERT INTO `ponderacioncaracteristica` VALUES ('209', '8', '0.94', 'Para el desarrollo académico integral el Programa debe contar con las actividades pedagógicas, medios y sitios de práctica acorde con las competencias definidas en su estructura curricular.', '12', '144');
INSERT INTO `ponderacioncaracteristica` VALUES ('210', '9', '12', 'La existencia de programas de Bienestar Universitario en la Facultad en coordinación con las políticas trazadas desde el comité central de Bienestar Universitario, contribuye a la formación un especialista en Ciencias Penales y Criminológicas que atienda a los criterios en atención a la Visión y la Misión del Programa. Así mismo, los servicios ofrecidos, en este campo, deben materializarse, a través de la accesibilidad de todos los estamentos. Por lo anterior es necesaria una permanente disponibilidad presupuestal para el logro efectivo de los objetivos trazados.', '12', '145');
INSERT INTO `ponderacioncaracteristica` VALUES ('211', '9', '3.25', 'Es de fundamental importancia la permanente capacitación del personal administrativo del Programa, pues en ellos se encuentra la función organizacional y de gestión, tendiendo a la consecución de un excelente producto académico, investigativo, cultural, etc., a los diferentes estamentos, y en el cubrimiento de las necesidades que tengan ocurrencia.', '12', '146');
INSERT INTO `ponderacioncaracteristica` VALUES ('212', '9', '3.25', 'El sistema de información y comunicación es un elemento que posibilita el desarrollo del Programa y de la comunidad académica, los cuales se verán favorecidos con canales óptimos de divulgación de los recursos  con que se cuenta, tendiente a que sean percibidos en el servicio.', '12', '147');
INSERT INTO `ponderacioncaracteristica` VALUES ('213', '10', '3.61', 'La dirección del Programa permite la satisfacción de los problemas planteados, a partir de estrategias soportadas en diagnósticos, todo con el fin de guardar coherencia con los lineamientos misionales establecidos por el mismo.', '12', '148');
INSERT INTO `ponderacioncaracteristica` VALUES ('214', '8', '2.89', 'El Programa ofrece servicios académicos óptimos y coherentes con las necesidades y ofrecimientos del medio, cumpliendo a cabalidad con lo ofrecido en virtud del criterio de coherencia.', '12', '149');
INSERT INTO `ponderacioncaracteristica` VALUES ('215', '9', '4.33', 'La Universidad por intermedio del Programa de especialización en Ciencias Penales y Criminológicas, ha de propender por su posicionamiento en el medio nacional, local e internacional. Debe propender por mantener el status y proyectarse a espacios no cubiertos aun dentro de lo social.', '12', '150');
INSERT INTO `ponderacioncaracteristica` VALUES ('216', '8', '3.85', 'El seguimiento de los egresados del Programa de Especialización en Ciencias Penales y Criminológicas es importante por cuanto permite medir la pertinencia de este en el medio, y permite conocer las necesidades del currículo en la búsqueda de soluciones eficaces.', '12', '151');
INSERT INTO `ponderacioncaracteristica` VALUES ('217', '10', '4.81', 'El reconocimiento del egresado permite comprobar si se ha cumplido con los objetivos del Programa      y además constatar que el especialista en ciencias penales y criminológicas de la Universidad de Cartagena es el que la sociedad necesita o requiere.', '12', '152');
INSERT INTO `ponderacioncaracteristica` VALUES ('218', '7', '4.08', 'La planta física en el Programa de Especialización en Ciencias Penales y Criminológicas es fundamental para el desarrollo de las funciones de docencia, investigación y extensión, así como también para el desarrollo del bienestar.', '12', '153');
INSERT INTO `ponderacioncaracteristica` VALUES ('219', '8', '4.67', 'Es fundamental garantizar el funcionamiento del presupuesto del programa, pues este posibilita la materialización de su Misión. Si no se cuenta con los recursos mínimos adecuados para su funcionamiento, no sería posible el desarrollo de sus funciones básicas: docencia, investigación y servicio social o extensión.', '12', '154');
INSERT INTO `ponderacioncaracteristica` VALUES ('220', '9', '5.25', 'La administración de recursos es indispensable para la buena distribución del presupuesto en las diferentes áreas y necesidades que debe cumplir el Programa de especialización en Ciencias Penales y Criminológicas y además que el presupuesto asignado se ejecute dentro de estas políticas en forma eficiente, eficaz y transparente.', '12', '155');
