INSERT INTO `ponderacionfactor` VALUES ('11', '13', 'El cumplimiento de los objetivos se convierte en el norte del programa, sin el no se puede apreciar su operacionalización, tanto en los procesos académicos, como en los administrativos, ni el compromiso del programa con la calidad y con el entorno. Todos los estamentos deben conocer la razón de ser del programa ', '7', '13');
INSERT INTO `ponderacionfactor` VALUES ('12', '12', 'Nuestra misión está dirigida a la formación integral del estudiante, basándose en los lineamientos del método constructivista, fomentándose el APRENDIZAJE AUTODIRIGIDO, como herramienta para la formación durante la especialización y para la educación médica continuada al egresar de la facultad ', '7', '14');
INSERT INTO `ponderacionfactor` VALUES ('13', '10', 'El stock de docentes presume una garantía para el desarrollo de una docencia de calidad y como resultado de la misma, un egresado altamente competitivo ', '7', '15');
INSERT INTO `ponderacionfactor` VALUES ('14', '13', 'El producto final de la especialización de medicina interna es la formación integral del especialista, bio-psico-social, para tal fin es necesario los lineamientos curriculares, que se convierten en el camino a seguir durante el programa, garantizando la excelencia en la formación académica', '7', '16');
INSERT INTO `ponderacionfactor` VALUES ('15', '12', 'Una de las funciones básicas de la educación superior es la investigación. El compromiso institucional y del programa frente al desarrollo del proceso misional de investigación determinará la calidad de la educación. ', '7', '17');
INSERT INTO `ponderacionfactor` VALUES ('16', '8', 'El paciente es entendido, en la especialidad de medicina interna, como un ser integral, y así el manejo de sus patologías es multidisciplinario, lo que genera en el estudiantes de posgrado y el especialista un enfoque articulador con las demás especialidades y profesiones del área de la salud ', '7', '18');
INSERT INTO `ponderacionfactor` VALUES ('17', '5', 'El avance vertiginoso que se da a nivel científico nos obliga, a la continua adaptación de nuestro plan curricular, para dar respuesta a los requerimientos internacionales, y así formar egresados con la capacidad de tener una visión mundial y actualizada de los conocimientos adquiridos y en desarrollo ', '7', '19');
INSERT INTO `ponderacionfactor` VALUES ('18', '7', 'Los docentes, trabajadores administrativos y estudiantes, requieren de espacios en donde puedan desarrollar sus aptitudes artísticas, culturales y deportivas. De una u otra manera estas actividades influyen en el componente integral de toda la comunidad universitaria y en su realización. ', '7', '20');
INSERT INTO `ponderacionfactor` VALUES ('19', '11', 'La calidad en el desempeño del egresado refleja la calidad en la formación que imparte el programa, y genera cambios positivos en el entorno donde se desarrolla. ', '7', '21');
INSERT INTO `ponderacionfactor` VALUES ('20', '9', 'La infraestructura aporta elementos importantes en el proceso de formación del estudiante. La planta física es fundamental para el desarrollo de las funciones de docencia, investigación y extensión, así como también para el desarrollo del bienestar.', '7', '22');
INSERT INTO `ponderacionfactor` VALUES ('21', '11', 'Representa la filosofía y la razón de ser de la Institución y del programa, marca el direccionamiento estratégico para el logro de los objetivos  y propósitos misionales que contribuyen al alcance de la Visión, en concordancia con los principios y valores.', '8', '3');
INSERT INTO `ponderacionfactor` VALUES ('22', '12', 'Los estudiantes son los usuarios primarios del programa académico y actores importantes para la puesta en marcha de los procesos misionales.', '8', '4');
INSERT INTO `ponderacionfactor` VALUES ('23', '13', 'Los profesores son los gestores de la dinámica misional del programa.', '8', '5');
INSERT INTO `ponderacionfactor` VALUES ('24', '13', 'Los procesos académicos claramente definidos garantizan la calidad de la formación, en la que la interdisciplinariedad, la flexibilidad y la evaluación curricular son coherentes con la formación integral de los estudiantes.', '8', '6');
INSERT INTO `ponderacionfactor` VALUES ('25', '7', 'Representa el reconocimiento del programa por la comunidad académica nacional  e internacional en virtud de los resultados de sus procesos misionales.', '8', '7');
INSERT INTO `ponderacionfactor` VALUES ('26', '12', 'La investigación es uno de los procesos misionales que contribuye a la formación de profesionales competentes  con el fin de generar conocimiento científico e innovación  para la transformación social y búsqueda de la identidad cultural ', '8', '8');
INSERT INTO `ponderacionfactor` VALUES ('27', '7', 'El Bienestar  se constituye en un proceso de apoyo para la creación de condiciones adecuadas que favorecen el desarrollo de los procesos misionales.', '8', '9');
