INSERT INTO `ponderacionfactor` VALUES ('41', '13', 'El programa está dirigido hacia el cumplimiento de los objetivos trazados, convirtiéndose en la meta, ya que permite apreciar su operacionalización, tanto en los procesos académicos, los administrativos y en el compromiso del programa con la calidad y con el entorno, por lo cual todos los miembros del programa deben estar comprometidos con el cumplimiento de estos.', '5', '13');
INSERT INTO `ponderacionfactor` VALUES ('42', '12', 'Los estudiantes son el sustrato hacia el cual se dirige todas las actividades del programa, con el fin de formar profesionales integrales, basándose en los lineamientos del método constructivista, fomentando el aprendizaje autodirigido como herramienta para la formación durante la especialización y en su formación continuada al egresar del programa.', '5', '14');
INSERT INTO `ponderacionfactor` VALUES ('43', '11', 'Un grupo de docentes sólidamente estructurados en su formación académica y con bases éticas bien forjadas prevé una garantía para el desarrollo de una docencia de calidad, generando un acompañamiento permanente y consecuentemente un estudiante que al egresar será altamente competitivo.', '5', '15');
INSERT INTO `ponderacionfactor` VALUES ('44', '11', 'Los procesos académicos claramente definidos garantizan la calidad de la formación, en la que la interdisciplinariedad, la flexibilidad y la evaluación curricular son coherentes con la formación integral de los estudiantes, garantizando la formación de un especialista integral en las áreas biopsicosocial.', '5', '16');
INSERT INTO `ponderacionfactor` VALUES ('45', '10', 'La investigación es uno de los procesos misionales que contribuye a la formación de profesionales competentes  con el fin de generar conocimiento científico e innovación  para la transformación social y búsqueda de la identidad cultural. El compromiso institucional y del programa frente al desarrollo del proceso misional de investigación determinará la calidad de la educación.', '5', '17');
INSERT INTO `ponderacionfactor` VALUES ('46', '8', 'En medicina y por ende en el programa de urología, el paciente es entendido como un ser integral, por lo cual el manejo de sus patologías es multidisciplinario, lo que genera en los estudiantes de posgrado y los egresados un enfoque articulador con las demás especialidades y profesiones del área de la salud.', '5', '18');
INSERT INTO `ponderacionfactor` VALUES ('47', '7', 'El avance vertiginoso que se da a nivel científico nos obliga, a la continua adaptación de nuestro plan curricular, para dar respuesta a los requerimientos internacionales, y así formar egresados con la capacidad de tener una visión mundial y actualizada de los conocimientos adquiridos y en desarrollo.', '5', '19');
INSERT INTO `ponderacionfactor` VALUES ('48', '7', 'Los docentes, trabajadores administrativos y estudiantes, requieren de espacios en donde puedan desarrollar sus aptitudes artísticas, culturales y deportivas. De una u otra manera estas actividades influyen en el componente integral de toda la comunidad universitaria y en su realización.', '5', '20');
INSERT INTO `ponderacionfactor` VALUES ('49', '11', 'La calidad en el desempeño del egresado refleja la calidad en la formación que imparte el programa, y genera cambios positivos en el entorno donde se desarrolla.', '5', '21');
INSERT INTO `ponderacionfactor` VALUES ('50', '10', 'La infraestructura aporta elementos importantes en el proceso de formación del estudiante. La planta física es fundamental para el desarrollo de las funciones de docencia, investigación y extensión, así como también para el desarrollo del bienestar. Los recursos físicos y financieros viabilizan y garantizan la ejecución del proyecto educativo del programa.', '5', '22');
INSERT INTO `ponderacionfactor` VALUES ('51', '11', 'La misión, visión y proyecto educativo del programa están de acuerdo con la misión, visión y proyecto educativo de la institución, las cuales deben ser conocidas por la comunidad académica del programa.', '9', '3');
INSERT INTO `ponderacionfactor` VALUES ('52', '10', 'El conocimiento de los derechos, deberes y reglas generales son fundamentales para la formación integral de los estudiantes del programa', '9', '4');
INSERT INTO `ponderacionfactor` VALUES ('53', '10', 'Profesores con un buen nivel de formación académica y comprometidos con la docencia y la investigación contribuyen a una formación de calidad de los estudiantes del programa', '9', '5');
INSERT INTO `ponderacionfactor` VALUES ('54', '10', 'El programa ofrece a sus estudiantes un currículo integral y flexible el cual está en concordancia con los referentes nacionales e internacionales ofreciendo a la comunidad académica un programa de calidad.', '9', '6');
INSERT INTO `ponderacionfactor` VALUES ('55', '9', 'Las relaciones con las comunidades matemáticas nacionales e internacionales a través de los vínculos académicos que tiene el programa a través de sus docentes y los eventos que realiza, permiten que estas comunidades tengan una amplia visión del programa.', '9', '7');
INSERT INTO `ponderacionfactor` VALUES ('56', '10', 'La formación investigativa transversal en el proceso de formación y la participación de estudiantes en el programa de semilleros de grupos de investigación, constituyen un elemento importante en la calidad del programa.', '9', '8');
INSERT INTO `ponderacionfactor` VALUES ('57', '11', 'Los programas de bienestar con que cuenta la universidad han contribuido a la formación integral de los estudiantes y a la obtención de calidad de vida en la comunidad académica del programa.', '9', '9');
INSERT INTO `ponderacionfactor` VALUES ('58', '10', 'La administración del programa está comprometida con la revisión, actualización del currículo y procesos de autoevaluación, gestionando de esta manera el compromiso que tiene con la docencia y la investigación.', '9', '10');
INSERT INTO `ponderacionfactor` VALUES ('59', '12', 'El impacto que los egresados tienen en la sociedad, tanto en la parte laboral como en la académica, es referente de la formación de calidad que ofrece el programa.', '9', '11');
